CREATE OR REPLACE TRIGGER hockey_pool.bi_draft_round
  before insert on hockey_pool.draft_round
  for each row  
begin   
  if :NEW.round_id is null then 
    select hockey_pool.draft_round_seq.nextval into :NEW.round_id from dual; 
  end if; 
end;
/

