create or replace package pkg_pool is

procedure insert_point(p_skater_id number,
                         p_game_id number,
                         p_goals number,
                         p_assists number,
                         p_plus_minus number,
                         p_shg number,
                         p_sha number,
                         p_gwa number,
                         p_ena number,
                         p_ppg number,
                         p_ppa number,
                         p_gwg number,
                         p_psg number,
                         p_eng number,
                         p_pims number,
                         p_pims_drawn number,
                         p_hits number,
                         p_shots number,
                         p_blocked_shots number,
                         p_misses number,
                         p_blocks number,
                         p_fights number,
                         p_giveaways number,
                         p_takeaways number,
                         p_faceoff_wins number,
                         p_faceoff_losses number,
                         p_toi varchar2,
                         p_shootout_goals number,
                         p_shootout_misses number,
                         p_wins number,
                         p_ot_losses number,
                         p_saves number,
                         p_shutouts number,
                         p_penshot_saves number,
                         p_penshot_ga number,
                         p_shootout_saves number,
                         p_shootout_ga number,
                         p_ga number,
                         p_first_stars number,
                         p_second_stars number,
                         p_third_stars number,
                         p_fantasy_points number);
end pkg_pool;
/

create or replace package body pkg_pool is
  procedure insert_point(p_skater_id number,
                         p_game_id number,
                         p_goals number,
                         p_assists number,
                         p_plus_minus number,
                         p_shg number,
                         p_sha number,
                         p_gwa number,
                         p_ena number,
                         p_ppg number,
                         p_ppa number,
                         p_gwg number,
                         p_psg number,
                         p_eng number,
                         p_pims number,
                         p_pims_drawn number,
                         p_hits number,
                         p_shots number,
                         p_blocked_shots number,
                         p_misses number,
                         p_blocks number,
                         p_fights number,
                         p_giveaways number,
                         p_takeaways number,
                         p_faceoff_wins number,
                         p_faceoff_losses number,
                         p_toi varchar2,
                         p_shootout_goals number,
                         p_shootout_misses number,
                         p_wins number,
                         p_ot_losses number,
                         p_saves number,
                         p_shutouts number,
                         p_penshot_saves number,
                         p_penshot_ga number,
                         p_shootout_saves number,
                         p_shootout_ga number,
                         p_ga number,
                         p_first_stars number,
                         p_second_stars number,
                         p_third_stars number,
                         p_fantasy_points number)
  as
    l_count number;
    begin
      select count(*)
        into l_count
        from hockey_pool.points p
       where p.point_skater_id = p_skater_id
         and p.point_game_id = p_game_id;
         
      if l_count = 0 then
           point_game_id,
           goals,
           assists,
           plus_minus,
           shg,
           sha,
           gwa,
           ena,
           ppg,
           ppa,
           gwg,
           psg,
           eng,
           pims,
           pims_drawn,
           hits,
           shots,
           blocked_shots,
           misses,
           blocks,
           fights,
           giveaways,
           takeaways,
           faceoff_wins,
           faceoff_losses,
           toi,
           shootout_goals,
           shootout_misses,
           wins,
           ot_losses,
           saves,
           shutouts,
           penshot_saves,
           penshot_ga,
           shootout_saves,
           shootout_ga,
           ga,
           first_stars,
           second_stars,
           third_stars,
           fantasy_points)
        values
          (p_skater_id,
           p_game_id,
           p_goals,
           p_assists,
           p_plus_minus,
           p_shg,
           p_sha,
           p_gwa,
           p_ena,
           p_ppg,
           p_ppa,
           p_gwg,
           p_psg,
           p_eng,
           p_pims,
           p_pims_drawn,
           p_hits,
           p_shots,
           p_blocked_shots,
           p_misses,
           p_blocks,
           p_fights,
           p_giveaways,
           p_takeaways,
           p_faceoff_wins,
           p_faceoff_losses,
           p_toi,
           p_shootout_goals,
           p_shootout_misses,
           p_wins,
           p_ot_losses,
           p_saves,
           p_shutouts,
           p_penshot_saves,
           p_penshot_ga,
           p_shootout_saves,
           p_shootout_ga,
           p_ga,
           p_first_stars,
           p_second_stars,
           p_third_stars,
           p_fantasy_points);
      else
        update hockey_pool.points p
           set p.goals = p_goals,
               p.assists=p_assists,
               p.plus_minus=p_plus_minus,
